('AI002', 'K002', '53765365', 'RPL B Angkatan 16 Juara Umum Akrobat 2019!', 'Hari Sabtu, 02 November 2020 diadakan acara tahunan Akrobat yang sangat bergengsi antar kelas di STM', 'Hari Sabtu, 02 November 2020 diadakan acara tahunan Akrobat yang sangat bergengsi antar kelas di STM. Pada hari itu merupakan hari penampilan dan pembuktian setelah 2 bulan berlatih untuk mengikuti ajang perlombaan akrobat. RPL mengirimkan 4 pasukan yang mengikuti ajang Akrobat yang terdiri dari X RPL A angkatan 17, X RPL B Angkatan 17, XI RPL A Angkatan 16, dab XI RPL B Angkatan 16. Pasukan dari XI RPL B angkatan 16 mendapatkan nomor urut ke 47, merupakan nomor urut 3 terakhir dari jumlah seluruh peserta sehingga pasukan mempunyai keuntungan waktu untuk latihan agar lebih matang.\r\nPada saat latihan pasukan berinisiatif untuk menginap bersama agar pada saat malam hari dapat berllatih dan semakin yakin akan penampilan di esok hari. Meskipun dalam setiap masih saja ada kesalahan ataupun kendala selama latihan, pasukan tetap berusaha untuk meyakinkan masing masing agar tetap bersama dan solid sampai akhir penampilan. Lama setelah menanti persiapan untuk tampil kami pun memasuki Daerah Persiapan dengan kostum kemeja putih dan topi pasukan. Memang pada saat itu kostum yang kami gunakan sangat sederhana dan tidak mengharapkan untuk mengejar juara kostum karena budget yang terbatas. Setelah beberapa detik lagi menuju penampilan kami pun meyakinkan diri masing masing dan memulai penampilan. Dan penampilan kami pun lancar meskipun ada beberapa kesalahan kecil, tetapi ternyatra keberuntungan berpihak pada kami sampai pengumuman kejuaraan menyatakan bahwa pasukan kami memenangkan Juara PBB Murni terbaik, Juara Variasi Formasi Terbaik, Juara 1 Utama, Juara 1 Danton Terbaik, dan Juara UMUM.', '2021-02-24', , 'image/jpeg', 'landscape', 1);
INSERT INTO `info_jurusan` (`id_info`, `id_kategori`, `nik`, `judul`, `prolog`, `deskripsi`, `tanggal`, `image`, `image_type`, `orientasi`, `verifikasi`) VALUES
('AI003', 'K001', '53765365', 'Hah BAPER? Buka Puasa Bareng RPL!', 'BAPER atau disingkat Buka Puasa Bareng RPL merupakan acara tahunan buka puasa RPL bulan suci Ramadhan', 'BAPER atau disingkat Buka Puasa Bareng RPL merupakan acara tahunan dari jurusan yang bertepatan dengan bulan suci Ramadhan dimana seluruh siswa dan siswi di jurusan bahkan alumni berkumpul untuk melaksanakan buka puasa bersama. Di dalam acara ini banyak sekali rangkaian acara yang dibuat oleh akang teteh kelas 10, yang tentunya asik dan menyenangkan. Acara ini juga menjadi ajang silaturahmi antara alumni, siswa dan sisi, serta guru juga sebagai ajang sharing pengalaman yang diberikan oleh alumni. Acaranya berlangsung sangat menarik dan menyenangkan dengan biaya 25K untuk tiket masuk mengikuti BAPER.', '2019-05-24', , 'image/jpeg', 'landscape', 1);
INSERT INTO `info_jurusan` (`id_info`, `id_kategori`, `nik`, `judul`, `prolog`, `deskripsi`, `tanggal`, `image`, `image_type`, `orientasi`, `verifikasi`) VALUES
('AI004', 'K001', '456345', 'Hari Keakraban RPL', 'Hari keakraban merupakan acara pendidikan yang diadakan oleh RPL untuk meningkatkan keakraban dan mental siswa dan siswi', 'Hari keakraban merupakan acara pendidikan yang diadakan oleh RPL untuk meningkatkan keakraban dan mental siswa dan siswi RPL SMK Negeri 1 Cimahi. Hari keakraban diselenggarakan dengan rangkaian acara pos to pos, sharing alumni, games, dan pembinaan mental. Acara nya berjalan sangat menyenangkan dan juga melelahkan. Banyak siswa dan siswi yang ikut berpartisipasi di dalam acara ini diantaranya kelas X dan XI', '2020-02-23', , 'image/jpeg', 'landscape', 1);

