('AK002', '53765365', 'Bagi kamu yang masih ragu untuk terjun  ke dalam pekerjaan ini, artikel kali ini sangat cocok untukmu.', 'Memahami Karier Seorang Software Engineer', 'Software engineer merupakan pihak yang berperan dalam proses analisis kebutuhan dan desain pengguna, konstruksi, dan uji aplikasi. Kebutuhan-kebutuhan tersebut akan dipenuhi melalui penggunaan bahasa pemrograman. Sederhananya, software engineer dapat diartikan sebagai orang yang berperan dalam penerapan prinsip-prinsip teknik pengembangan perangkat lunak.\r\n\r\nSeorang SE bertugas untuk mendalami sistem dan software dalam sebuah bisnis atau perusahaan. Program-program yang dikembangkan pun cukup beragam. Mulai dari aplikasi, games, sampai operating system.\r\n\r\nUntuk menjadi seorang SE yang handal dibutuhkan kombinasi kemampuan teknis serta soft skills. Di antaranya adalah :\r\n1. Programming\r\n2. Teliti\r\n3. Dapat bekerja sama dalam tim\r\n4. Mudah beradaptasi\r\n\r\nApakah bekerja menjadi seorang SE merupakan hal yang menjanjikan? Saat ini, dunia teknologi yang terus berkembang pesat membutuhkan orang-orang yang ahli dalam bidang tersebut. Nah, ini bisa jadi kesempatan emasmu untuk merebut posisi ini. Lalu, apakah ada jenjang dalam menjalani profesi sebagai SE? Berikut adalah jenjang atau kemajuan dari posisi tersebut:\r\n1. Junior software engineer\r\n2. Software engineer\r\n3. Senior software engineer\r\n4. Architect/principal software engineer', '2021-02-28', , 'image/jpeg', 1);
INSERT INTO `karir` (`id_karir`, `nik`, `prolog`, `judul_artikel`, `deskripsi`, `tanggal`, `image`, `image_type`, `verifikasi`) VALUES
('AK003', '53765365', 'Web Designer sederhananya adalah orang yang mendesain web. Tetapi, pada kenyataannya, pekerjaan ini tidaklah sesederhana', 'Senang Dunia Desain? Coba Pahami Karier Seorang Web Designer', 'ugas utama dari web designer adalah mendesain halaman-halaman di dalam web. Tetapi, jika dirunut lagi, mendesain halaman-halaman di dalam ternyata membutuhkan keterampilan tersendiri.\r\n\r\nKeterampilan inilah yang mesti dimiliki. Orang yang bergelut di pekerjaan ini meski memiliki rasa estetika yang bagus.\r\n\r\nIa mesti bisa memadukan dan memilih warna, font, layout, serta gambar yang cocok untuk ditaruh di halaman web.\r\n\r\nContohnya seperti ini. Jika sebuah halaman web ditujukan untuk anak-anak, maka mereka dituntut untuk bisa membuat halaman yang penuh warna.\r\n\r\nHalaman juga mesti dipadukan dengan font yang memanjakan mata, serta banyak gambar.\r\n\r\nSelain itu, layout dan struktur dari web sendiri tidak boleh rumit. Setiap halaman mesti bisa diakses dengan mudah oleh anak-anak. Intinya, halaman web mesti penuh dengan keceriaan dan kemudahan.\r\n\r\nLain hal dengan halaman web bagi orang-orang yang lebih profesional. Halaman memang tetap harus mudah diakses, dengan font yang tentunya juga mudah dibaca. Namun, halamannya tidak boleh semeriah halaman web anak-anak.\r\n\r\nHalaman web profesional harus lebih simpel dan terlihat lebih kasual. Perpaduan warna dan gambar yang ditampilkan juga tidak boleh terlalu berwarna-warni, serta harus memiliki pengaturan akses informasi yang baik.\r\n\r\nAspek estetika seperti itulah yang mesti dimiliki. Aspek ini akan mempengaruhi pekerjaan mereka dalam mendesain web. Mereka memiliki kontrol penuh terhadap desain dari halaman sebuah web.\r\n\r\nKontrol penuh inilah yang menjadikan seorang web designer harus paham banyak hal. Mereka harus paham bagaimana menyesuaikan web dengan calon pengakses.\r\n\r\nSelain itu, mereka juga harus paham bagaimana agar tampilan web mudah digunakan pengguna.', '2021-02-04', , 'image/jpeg', 1);

